import React from 'react'
let LeftSideStyles = {
  div: {
    width: '200px',
    height: '750px',
    backgroundColor: '#333333',
    textAlign: 'center',
    color: '#ffffff',
  },
  span: {
    fontSize: 20,
    color: 'white',
  },
}
export const LeftSide = () => {
  return (
    <div style={LeftSideStyles.div}>
      <span style={{ marginTop: 20, fontSize: 20 }}>Management Section</span>
      <hr />
      <span style={{ marginTop: 40, fontSize: 20 }}>Create New Post</span>
      <br />
      <br />
      <span style={{ marginTop: 60, fontSize: 20 }}>See Recent Post</span>
      <br />
      <br />
      <span style={{ marginTop: 80, fontSize: 20 }}>Profile Setting</span>
    </div>
  )
}
